schemaDefinition: "create or replace view SRC_V_DIM_TARGETS(\n\tTARGET_ID,\n\tQUARTER_ID,\n\
  \tQUARTER_DT,\n\tQUARTER_YYQQ,\n\tJOB_FUNCTION,\n\tJOB_LEVEL,\n\tGEO,\n\tUTLIZATION_GATE,\n\
  \tUTLIZATION_TARGET,\n\tTIME_CARD_SUBMITTED_COMPLIANCE_TARGET,\n\tTIME_CARD_APPROVED_COMPLIANCE_TARGET,\n\
  \tTIME_CARD_APPROVED_COMPLIANCE_SCORE,\n\tUTLIZATION_SCORE,\n\tTEAM_UTILIZATION_TARGET,\n\
  \tTEAM_UTILIZATION_GATE,\n\tTEAM_UTILIZATION_SCORE,\n\tRESOURCE_PLAN_ACCURACY_TARGET,\n\
  \tEXPENSE_REPORTS_COMPLIANCE_SCORE,\n\tEXPENSE_REPORTS_COMPLIANCE_TARGET,\n\tREMAINING_BACKLOG,\n\
  \tOVERALL_SATISFACTION_TARGET,\n\tSURVEY_RESPONSE_RATE_TARGET\n) as\nSELECT\nHASH(\"\
  KpiQuarter\"||\"KpiJobFunction\"||\"KPIGeo\"||\"KPIJobLevel\") AS TARGET_ID,\n\"\
  DIM_QUARTER\".QUARTER_ID as QUARTER_ID,\n\"DIM_QUARTER\".QUARTER_DT as QUARTER_DT,\n\
  \"DIM_QUARTER\".QUARTER_YYQQ as QUARTER_YYQQ,\n\"KpiJobFunction\" as JOB_FUNCTION,\n\
  \"KPIJobLevel\" as JOB_LEVEL,\n\"KPIGeo\" as GEO,\n\"KpiUtlizationGate\" as UTLIZATION_GATE,\n\
  \"KpiUtlizationTarget\" as UTLIZATION_TARGET,\n\"KpiTCSubmittedCompTarget\" as TIME_CARD_SUBMITTED_COMPLIANCE_TARGET,\n\
  \"KpiTCApprovedComplTarget\" as TIME_CARD_APPROVED_COMPLIANCE_TARGET,\n\"KpiTCApprovedComplScore\"\
  \ AS TIME_CARD_APPROVED_COMPLIANCE_SCORE,\n\"KpiUtlizationScore\" as UTLIZATION_SCORE,\n\
  \"KpiTeamUtilizationTarget\" as TEAM_UTILIZATION_TARGET,\n\"KpiTeamUtilizationGate\"\
  \ as TEAM_UTILIZATION_GATE,\n\"KpiTeamUtilizationScore\" as TEAM_UTILIZATION_SCORE,\n\
  \"KpiResourcePlanAccuracyTarget\" as RESOURCE_PLAN_ACCURACY_TARGET,\n\"KpiExpenseReportsComplScore\"\
  \ as EXPENSE_REPORTS_COMPLIANCE_SCORE,\n\"KpiExpenseReportsComplTarget\" as EXPENSE_REPORTS_COMPLIANCE_TARGET,\n\
  \"KPIRemainingBacklog\" as REMAINING_BACKLOG,\n\"KpiOSATTarget\" as OVERALL_SATISFACTION_TARGET,\n\
  \"KpiSurveyResponseRateTarget\" as SURVEY_RESPONSE_RATE_TARGET\nFROM\n(SELECT *\
  \ FROM ODS_LS.\"FLATFILESOURCE\".\"PS_KPITARGETS\"  where left(\"KpiQuarter\",'random')\
  \ ='random') as \"TRAGET\"\nleft join EDW.ENTERPRISE.DIM_QUARTER as \"DIM_QUARTER\"\
  \ on right(\"TRAGET\".\"KpiQuarter\",'random')=\"DIM_QUARTER\".QUARTER_YYQQ;"
